import React from 'react';
import PropTypes from 'prop-types';
import Button from '../../../../shared/Button/Button';
import { ROUTES } from '../../../../../config/constants';
import { Link } from 'react-router-dom';

const CopyTelegramId = props => {
    return (
        <div className='bg-white p-7 rounded-md'>
            <h2 className='mb-7 text-2xl font-medium text-gray-800'>Copy Telegram ID</h2>
            <p className='text-gray-700 text-xl mb-10'>Copy your Telegram ID after starting the bot</p>

            <div className='flex justify-between'>
                <Link to={ROUTES.startBot.path}>
                    <Button
                        type={'primary'}
                        className={'text-gray-800 font-semibold bg-indigo-200 hover:bg-indigo-300 focus:bg-indigo-300'}
                    >
                        Previous
                    </Button>
                </Link>
                <Link to={ROUTES.enterTelegramID.path}>
                    <Button type={'primary'} className={'bg-indigo-600 hover:bg-indigo-700'}>
                        Next
                    </Button>
                </Link>
            </div>
        </div>
    );
};

CopyTelegramId.propTypes = {};

export default CopyTelegramId;
